<template>
    <div id="main-canvas-wrapper">     
        <canvas width="460" height="460" ref="canvas_ref" id="main-canvas" @mousemove="mousemove" @mouseleave="is_enter = false" @mouseenter="is_enter = true"></canvas>
    </div>
</template>

<script setup>
const canvas_ref = ref(null);

let animation_id = null;

onMounted(async () => {
    await nextTick();

    if (process.client) {
        const img = new Image();
        
        img.src = 'data:image/png;base64,'

        img.addEventListener('load', () => {
            init(img);
            window.addEventListener('resize', () => init(img));
        });
    }
});

let mouse_y = 0;
let mouse_x = 0;
let radius = 40;
let is_enter = ref(false);
const size = 2.5;

function mousemove(event) {
    mouse_y = event.offsetY;
    mouse_x = event.offsetX;
}

function init(img) {
    cancelAnimationFrame(animation_id);

    if (window.innerWidth <= 1200) {    
        return;
    }

    const ctx = canvas_ref.value.getContext('2d');
    canvas_ref.value.width  = 460;
    canvas_ref.value.height = 460;

    ctx.drawImage(img, 0, 0, canvas_ref.value.width, canvas_ref.value.height);
    const pixels = ctx.getImageData(0, 0, canvas_ref.value.width, canvas_ref.value.height);
    ctx.clearRect(0, 0, canvas_ref.value.width, canvas_ref.value.height);

    let particlesArray = [];
    const numberOfParticles = 5000;

    let mappedImage = [];
    for (let y = 0; y < canvas_ref.value.height; y++) {
        let row = [];
        for (let x = 0; x < canvas_ref.value.width; x++) {
            const red   = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue  = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                brightness,
                'rgb(' + red + ','+ green + ',' + blue + ')'
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299  +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/100;
    }

    class Particle {
        constructor() {
            this.x = Math.random() *  canvas_ref.value.width;
            this.y = Math.random() *  canvas_ref.value.height;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 3 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.fillStyle = '#FFF';
        }

        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            
            if (mappedImage[this.position1] && mappedImage[this.position1][this.position2]) {
                this.speed     = mappedImage[this.position1][this.position2][0] ?? 0;
                this.fillStyle = mappedImage[this.position1][this.position2][1] ?? '#FFF';
            } else {
                this.fillStyle = '#FFF';
            }

            let movement = (2.5 - this.speed) + this.velocity;
            
            if (radius > 0 && Math.pow((this.position1 - mouse_y), 2) + Math.pow((this.position2 - mouse_x), 2) <  Math.pow(radius - 10, 2)) {
                const Xer = (mouse_x - this.x) || 1;
                const Yer = (mouse_y - this.y) || 1;
                const hypotenuse = Math.pow(Math.sqrt(Xer*Xer+Yer*Yer) / 2, 2);

                this.y += (radius / (hypotenuse)) * -Math.sin((mouse_y - this.y) / 12) * 12;
                this.x += (radius / (hypotenuse)) * -Math.sin((mouse_x - this.x) / 12) * 12;
            } else {
                this.y += -movement + Math.sin(87);
                this.x += movement;
            }
            
            if (this.y > canvas_ref.value.height) {
                this.x = Math.random() * canvas_ref.value.width;
                this.y = 0;
            }

            if (this.y < 0) {
                this.x = Math.random() * canvas_ref.value.width;
                this.y = canvas_ref.value.height;
            }

            if (this.x > canvas_ref.value.width) {
                this.x = 0;
                this.y = Math.random() * canvas_ref.value.height;
            }

            if (this.x < 0) {
                this.x = canvas_ref.value.width;
                this.y = Math.random() * canvas_ref.value.height;
            }
        }

        draw() {
            ctx.beginPath();
            ctx.fillStyle = this.fillStyle;
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    for (let i = 0; i < numberOfParticles; i++) {
        particlesArray.push(new Particle);
    }

    function animate() {
        if (is_enter.value) {
            radius += 0.5;

            if (radius > 40) {
                radius = 40;
            }
        } else {
            radius -= 0.3;

            if (radius < 0) {
                radius = 0;
            }
        }

        ctx.globalAlpha = 0.05;
        ctx.fillStyle = '#FFF';
        ctx.fillRect(0, 0, canvas_ref.value.width, canvas_ref.value.height);

        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }

        animation_id = requestAnimationFrame(animate);
    }

    animate();
}

onBeforeUnmount(() => {
    cancelAnimationFrame(animation_id);
}); 
</script>

<style>
#main-canvas-wrapper {
    display: flex;
    align-items: center;
    justify-content: center;
    position: relative;
}

#main-canvas {
    border-radius: 50%;
}

@media screen and (max-width: 1200px) {
    #main-canvas-wrapper {
        display: none;
    } 
}
</style>